    false,nt"url": null,nt"notes": "This annual narrative report for Arctic
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, volunteer programs, funding, and safety is given.
    Habitat management is also covered; subjects include wetlands, forests, grazing,
    haying, fire management, and wilderness areas. The wildlife section of the report
    discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
    raptors, game mammals, marine mammals, wildlife propagation, and marking and bird
    banding. The public uses of the Refuge described in this report include interpretive
    programs, hunting, fishing, trapping, wildlife observation, and law enforcement.
    The equipment and facilities section of the report provides information about equipment
    replacement, communication systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end.",nt"license_title": "License
